const users: string = "/users";
const comments: string = "/comments";
const posts: string = "/posts";
const albums: string = "/albums";
const photos: string = "/photos";
const todos: string = "/todos";

export const ApiUrl: { [key: string]: string } = {
  users,
  comments,
  posts,
  albums,
  photos,
  todos,
};
